class Profile extends React.Component {

constructor(props) {
  super(props);
  var data
}

componentDidMount=()=> {
   this.data=this.props
}

  render() {
    console.log(this.props);

    return (
        <h1> {this.data.UserEmail}</h1>

    )
  }
}


export default Profile;
